import React, { useState } from "react";
import "./Projects.css";

const Projects = () => {
  const [activeTab, setActiveTab] = useState(1);

  const projects = [
    { id: 1, title: "Project Title 1", description: "Lorem Ipsum is dummy text of the printing industry." },
    { id: 2, title: "Project Title 2", description: "Lorem Ipsum is dummy text of the printing industry." },
    { id: 3, title: "Project Title 3", description: "Lorem Ipsum is dummy text of the printing industry." },
    { id: 4, title: "Project Title 4", description: "Lorem Ipsum is dummy text of the printing industry." },
  ];

  const handleTabClick = (tabIndex) => {
    setActiveTab(tabIndex);
  };

  return (
    <div className="projects">
      <h1>Projects</h1>
      <p>
        Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's
        standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make
        a type specimen book.
      </p>
      <div className="tabs">
        <button
          className={activeTab === 1 ? "tab active-tab" : "tab"}
          onClick={() => handleTabClick(1)}
        >
          Tab 1
        </button>
        <button
          className={activeTab === 2 ? "tab active-tab" : "tab"}
          onClick={() => handleTabClick(2)}
        >
          Tab 2
        </button>
        <button
          className={activeTab === 3 ? "tab active-tab" : "tab"}
          onClick={() => handleTabClick(3)}
        >
          Tab 3
        </button>
      </div>
      <div className="projects-grid">
        {projects.map((project) => (
          <div
            key={project.id}
            className="project-card"
            onClick={() => window.open("https://example.com", "_blank")}
          >
            <h3>{project.title}</h3>
            <p>{project.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Projects;
